import React from "react";
import ReactDOM from "react-dom";
// component file
import TodoContainer from "./components/TodoContainer";
import { BrowserRouter as Router } from "react-router-dom";

// stylesheet
import "./App.css";

ReactDOM.render(
  <React.StrictMode>
    <Router>
      <TodoContainer />
    </Router>
  </React.StrictMode>,
  document.getElementById("root")
);
